import React from 'react';
import { View, Text, Image, StyleSheet, Dimensions } from 'react-native';

const getWindowDimensions = () => {
  const { width } = Dimensions.get('window');
  if (width <= 320) {  
    return {
      width: 300,
      height: 300,
      marginTop: 10,
    };
  } else if (width <= 768) {  
    return {
      width: 400,
      height: 400,
      marginTop: 15,
    };
  } else {  
    return {
      width: 700,
      height: 700,
      marginTop: 20,
    };
  }
}


export function Home({ navigation }) {

    return (
        <View style={styles.titleMobile}>
            <Text style={styles.headerText}>Kathariana</Text>
            <Text style={styles.headerText}>& Patrick</Text>
            <View style={styles.imageContainer}>
                <Image source={require('../assets/placholder.jpeg')} style={styles.mainImage} />
                <Image source={require('../assets/framegold.png')} style={styles.frameImage} />
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    titleMobile: {
        width: "100%",
        height: "98%",
        alignItems: 'center',
        justifyContent: 'center',

    },
    headerText: {
        fontFamily: 'Great Vibes',
        fontSize: 32,
        textAlign: 'center',
    },
    imageContainer: {
        width: '85%',
        height: '70%',
        zIndex: -1,
    },
    mainImage: {
      position: 'absolute',
        top: 45,
        left: 38,
        width: '80%',
        height: '80%',
        resizeMode: 'cover',
        borderRadius: 5,
    },
    frameImage: {
        position: 'absolute',
        top: 0,
        left: 0,
        width: '100%',
        height: '100%',
        resizeMode: 'cover',
        borderRadius: 20,
        zIndex: 1,
    },
});
